// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Link,Routes } from 'react-router-dom';
import Dashboard from './Components/Dashboard';
import ProductsManagement from './Components/ProductsManagement';
import OrdersManagement from './Components/OrdersManagement';
import OrdersCalendarView from './Components/OrdersCalendarView';

function App() {
  return (
    <Router>
      <Routes>
        <nav>
          <ul>
            <li>
              <Link to="/">Dashboard</Link>
            </li>
            <li>
              <Link to="/products">Products Management</Link>
            </li>
            <li>
              <Link to="/orders">Orders Management</Link>
            </li>
            <li>
              <Link to="/calendar">Orders Calendar View</Link>
            </li>
          </ul>
        </nav>

        <Route path="/" exact component={Dashboard} />
        <Route path="/products" component={ProductsManagement} />
        <Route path="/orders" component={OrdersManagement} />
        <Route path="/calendar" component={OrdersCalendarView} />

      </Routes>
    </Router>
  );
}

export default App;
